import React from 'react';
import useHandles from '../useHandles';
import confirmIcon from "../images/confirm.png";
import cancelIcon from "../images/cancel.png";
import '../../App.css';

export default function DeletePopup() {
  const { deletePopup, setDeletePopup } = useHandles();

  const handleCancel = () => {
    setDeletePopup(false);
  };

  return <div className={deletePopup ? "showPopup" : "hidePopup"}>
    <button>
      <img src={ confirmIcon } width="24px" alt="logo" />
    </button>
    <button
      onClick={ ()=> handleCancel() }
    >
      <img src={ cancelIcon } width="24px" alt="logo" />
    </button>
  </div>
};
